import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";

const Search = () => {
  const [pesel, setPesel] = useState("");
  const [start_date, setStartDate] = useState("");
  const [end_date, setEndDate] = useState("");
  const [product_name, setProductName] = useState("");
  const [prescriptions, setPrescriptions] = useState([]);
  const [prescriptionInformations, setPrescriptionInformations] = useState([]);

  const getPrescriptionSearchData = () => {
    Axios.post("http://localhost:8080/api/test3", {
      pesel: pesel,
      startDate: start_date,
      endDate: end_date,
      productName: product_name,
    }).then((res) => {
      setPrescriptions(res.data);
      console.log(res.data);
    });
  };

  let PrescriptionList = prescriptions.map((prescription, i) => {
    console.log(prescription);
    return (
      <option key={i} value={i}>
        {prescription.codeEAN}
      </option>
    );
  }, this);
  return (
    <div className="App">
      <Header>Wyszukiwarka Recept</Header>
      <div className="inputsWrapper">
        <div>
          <label>Pesel:</label>
          <input
            type="text"
            name="pesel"
            onChange={(e) => {
              setPesel(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data od:</label>
          <input
            type="date"
            name="start_date"
            onChange={(e) => {
              setStartDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data do:</label>
          <input
            type="date"
            name="end_date"
            onChange={(e) => {
              setEndDate(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Nazwa Leku:</label>
          <input
            type="text"
            name="product_name"
            onChange={(e) => {
              setProductName(e.target.value);
            }}
          />
        </div>
      </div>

      <button onClick={getPrescriptionSearchData}>
        getPrescriptionSearchData
      </button>
      <select
        value
        onChange={(e) => {
          console.log(prescriptions[e.target.value]);
          setPrescriptionInformations(prescriptions[e.target.value]);
        }}
      >
        {PrescriptionList}
      </select>
      {prescriptionInformations != null && (
        <div className="medicineTable">
          <div>
            <p>{prescriptionInformations.codeEAN}</p> <p>EAN</p>
          </div>
          <div>
            <p>{prescriptionInformations.name}</p> <p>Nazwa</p>
          </div>
          <div>
            <p>{prescriptionInformations.numberOfMedicinePackages}</p>{" "}
            <p>Ilość tabletek</p>
          </div>
          <div>
            <p>{prescriptionInformations.paymentLevel}</p>{" "}
            <p>Procent odpłatności</p>
          </div>
          <div>
            <p>{prescriptionInformations.prescriptionKey}</p>{" "}
            <p>Klucz recepty</p>
          </div>
          <div>
            <p>{prescriptionInformations.prescriptionNr}</p>{" "}
            <p>Numer recepty</p>
          </div>
          <div>
            <p>{prescriptionInformations.signingData}</p> <p>Data</p>
          </div>
          <div>
            <p>{prescriptionInformations.prescriptionStatus}</p> <p>Data</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default Search;
